import React from "react";
import HorsePath from "../assets/HorsePath";

const HorseSVG = () => {
  return (
    <div className="w-[10rem] animate-[fade_4s_ease-in-out]">
      <svg width="100%" viewBox="0 0 236 333">
        <HorsePath />
      </svg>
    </div>
  );
};

export default HorseSVG;
